import React, { Component } from 'react';

export default class Counter extends Component {
	state = {
		count: 1,
		imageUrl:'https:picsum.photos.200'
	};

	render() {
		return (
			<div> 
				<img src={this.state.imageUrl} alt = "" />
				<span> {this.state.count} </span>
				<button> Increment</button>
			</div>
		); 
	}
}
